                case TES4_FieldIndex.Header:
                    this.Header = new MaskItem<Exception, Header_ErrorMask>(ex, null);
                    break;
                case TES4_FieldIndex.TypeOffsets:
                    this.TypeOffsets = ex;
                    break;
                case TES4_FieldIndex.Deleted:
                    this.Deleted = ex;
